import React from 'react';
import {Link} from 'react-router-dom';

const NavBar = () => {
  return (
    <div className="App">
      <ul class="nav justify-content-center grey lighten-5 py-4">
        <li class="nav-item">
          <a class="nav-link" href="#!">
            Home
          </a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#!">
            Demographics
          </a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#!">
            Deep Dive
          </a>
        </li>
      </ul>
    </div>
  );
}

export default NavBar;
